ფრაქცია "ქრისტიან–დემოკრატები"–ს მდივანი;
ჯანმრთელობის დაცვისა და სოციალურ საკითხთა კომიტეტის თავმჯდომარის მოადგილე;
საპროცედურო საკითხთა და წესების კომიტეტის წევრი;
საპარლამენტო უმცირესობის მდივანი

ფრაქცია "ერთობა სამართლიანობისთვის"–ს წევრი ჯანმრთელობის დაცვისა და სოციალურ საკითხთა კომიტეტის წევრი;
იურიდიულ საკითხთა კომიტეტის წევრი ინტერფრაქციული ჯგუფი;  
საქართველოს კონტროლის პალატის 2011 წლის საფინანსო–ეკონომიკური საქმიანობის აუდიტის განმახორციელებელი საქართველოს პარლამენტის დროებითი კომისია
